import axios from "axios";
import { JobType } from "../redux/jobSlice";

export default async function getJobsRequest() {
  try {
    const { data } = await axios.get<JobType[]>(
      "https://api.json-generator.com/templates/ZM1r0eic3XEy/data?access_token=wm3gg940gy0xek1ld98uaizhz83c6rh2sir9f9fu"
    );
    return data;
  } catch (error) {
    const res: JobType[] = [];
    return res;
  }
}

export async function getAddressRequest() {
  try {
    const { data } = await axios.get<JobType[]>(
      "https://maps.googleapis.com/maps/api/geocode/json?key=ТВОЙ-КЛЮЧ-АПИ&latlng=-26.927111,147.139488&sensor=false"
    );
    return data;
  } catch (error) {
    const res: JobType[] = [];
    return res;
  }
}

getJobsRequest();
